@YraxZovaldo that sounds like a very scientific response üòÉ
I think you may benefit from reading up a bit more on this subject. Don't get your info from MSM.
Plenty of factual, scientic info, from Climate Experts, out there- if you go look for it....with an OPEN mind

@Malicious Mike You are so bright. 

It's as if the action we took slowed climate change down?ü§î

The globe is clearly warming.

@Keanu Threeves these politicians and prophets of doom have been promising costal flooding for 40 years, when their predictions don‚Äôt come true, they just predict it again (and again), hoping you forget.
    After you‚Äôve seen this cycle several times, you can see thru the lies to their true agenda.

Hoax!

@Footshot Neill All that ice core data, sea/lake sedimentary data etc all show the climate is changing, just as it always has. 

There still no evidence that climate change is caused by increased carbon dioxide.

Best estimate is 1.7 W/m^2 increase in energy due to increased carbon dioxide. Its just noise in the signal when compared to all the other heat processes in the atmosphere. The difference is too small to measure with the tools available.

@Ken Van de Burgt 
Thats correct. As you can see the arctic sea ice is slowly incresing as a result of the cooling.
https://data.meereisportal.de/maps/latest/extent_long_n.png

@Flangelus Well, empirically the exponential spread of veganism has a ceiling, because most people are not vegans, as they would be by now if the "spread" worked akin to an unchecked infectious disease. Most likely, I suspect, there are some people who are suggestible to veganism, they need encouragement from others to make that jump but ultimately they were always predisposed to that sort of decision. The sort of word-of-mouth approach you suggest may reach say, ten to twenty percent of westerners, but I'm not sure that's really enough. If you really want a meat-free world, it would have to come from the top down, not the bottom up.

(I also note that you seem to have lapsed from making an environmental case at this point to being solely one over animal rights, which confirms my thoughts that you would have gone vegan anyway and the environmental factors are simply a side issue. Personally, I'm not too fussed over animal rights, it's just never been a high priority for me, humans are simply doing a more sophisticated version of what every apex predator before them did. This is obviously something we aren't ever going to agree on, because it is a fundamental difference in values.)

In terms of the teaching analogy, yes, I understand it is flawed. I'll give you that one. How about a better analogy - gun control in the US. Yes, gun owners could be more responsible. They could even decide to get rid of their guns voluntarily. But they just aren't going to. Whenever there is a mass shooting in the US, people blame the easy availability of lethal weapons - and they are completely right to look at government inaction rather than the individual perpetrator. I believe meat consumption (to the extent that it is polluting in a way that affects humans) is in a similar category to gun ownership.

@Alex Potts My man you should know by now how this works... 4 people that I know of, one of them I know for sure changed 2 or 3 peeps... one of my friends enlightened me... 4 people change 4 people and you have 16, 16 people change 4 people each and you have 64...256... 1024... you see how this works? I know I'm not doing much but theres people on youtube who reach thousands. I'm telling you if you knew how they treat these animals and how bad it is for everything you would never touch meat again... it's not your fault youve been trained by society to think this is normal, but you have an obligation to know what the consequences of your actions are to others, is there a victim involved, does it harm the environment? take the blindfold off act in a way that reflects your morals. 

In order to change government (which i think is something we should do obviously) you need a large enough following. Every individual counts.  The teacher example doesnt work because you are not directly sabotaging the educational system, are you? where as by eating meat you are directly causing harm. A better example:

Every teacher uses violence on kids and it's normalised in society, you want to change the system so teachers don't hit kids whilst you are currently beating a child. You say "oh well I won't stop beating this child because I am 1 person.... what am I gonna do?" Lead by example, stop paying people to kill things for you. You're not a bad person, you are just well trained.

@Matthew Morycinski How right or wrong the comment above ends up being is dependent on how right or wrong the nessersery decarbonisation figers in the video are. Bear In mind that the statement in that comment assumes that TED is taking feedback loops into account. If this is not the case then just a annoyance is more like the minimum damage we can expect rather than the maximum. This also depends on how resilient humanity is by the time global temperatures have reached their peak.

2050 decarbonisation targets tend to be based off a linear growth in renewable energy rather than a the exponential one we are actually seeing. 

Digging tar sands is a bad idea not so much for a different reason more an additional reason. If something is harmful to the environment and not cost effective then it's not just a bad idea it's an insane idea.

@Alex Potts this chart is not about poor = climate conscious out if necessity and lack of access. 

There is only one country in Africa that has a ‚Äúblue‚Äù scaling. It is not their unique lack of wealth that earned them that distinction. It is their policies. 

Therefore, good for them for taking that stance.

@John Keith Marzo 
Speak only for yourself.
Maybe you have the impression to be a board a sinking ship. I don't.

@Oscar King Who says millions of people die because of climate change? 
That's ridiculous.  
Do you think people are going to die if the sea level goes up a little higher?

@Rick TD 
Easy, young man. We are on the same side. I'm also in it for some years now.
As you can see by the playlist "global warming" on my channel.

