@gamejaw And just two more remarks:
1) Why so hateful? Let go of hate. You may hate people, when you know them well enough, and know their motives. But just hating is terribly effortful and annoying, for others and yourself.
2) If you are so proud of the inventions of americans, why do you then listen to a media complex so much (and that is quite obvious from what you say), that is the supportive system of a president that sees science as a mere threat to his presidency. A president that refuses to hear any scientific advice on any topic, because he believes his gut judgement is better than millions of hard working hours of thousands of smart people working on the same problem?

@Shane d Carbon monoxide is a greenhouse gas, but it plays less of a role compared to CO2 (Carbon Dioxide), which is produced by power plants via the burning of what is essentially million year old biological waste in forms such as oil or coal 

Saying carbon dioxide is a fundamental product of life, while technically true, is deceptive wording. Carbon dioxide is literally a biological waste product. You exhale to excrete it. Feces and urine are also fundamental products of life by that logic, yet I don't think you're going to argue against plumbing.

If we're gonna talk about what is and isn't natural, keep in mind that oil and coal was buried by nature before we decided to dig it up and burn it. Nature decided to keep that stuff in the ground, not us. Who are we to go against it?

